(69534, 42158, 6329, 1, '幾分鐘的早班火車約會', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '呼吸舒發悶氣\n天空竟這樣美\n源自女神 髮梢風裡飛\n天天都會念記\n車廂中我共妳\n甜蜜氣息編寫我日記\n\n春風拂檻是我\n輕呼一下熱氣\n微妙音韻 耳邊吹奏起\n擠迫空氣內最\n親暱感覺絕美\n門限快推倒失去力氣\n\n一點點車廂中想試探 引導你\n盼有次剎車送上轉機　\n尷尬中反覆裡帶出缺憾美\n流露你厭惡中有歡喜\n\n沈溺 軟綿綿的空氣\n這是愛氣味\n旁觀者都不理\n偷嚐自暗喜\n\n實體 有別幻想空氣\n再沒有距離\n難得車中幽禁\n主演齣叫絕好戲\n\n口中所講跟真心意　永遠有差距\n聽一聽　誠實的身體說　禁斷盼允許\n含羞 中帶盡興眼淚\n接觸 障礙被移除 \n\n沈溺 軟綿綿的空氣\n這是愛氣味\n旁觀者都不理\n偷嘗自暗喜\n\n實體 有別幻想空氣\n再沒有距離\n難得車中幽禁\n主演齣叫絕好戲\n\n車廂中碰著你\n花光所有運氣\n遙望女神 已經心暗喜\n好很想要但我\n講不出我道理\n留下妄想充斥我日記\n\n光陰貶眼便過\n青春豈會盡美\n留下這編痴心漢日記\n', '', 206, '', '', '', '', 'StreetVoice', 'TWS651350001', 1, 1, 0, '2013-12-17 16:35:26', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
