(69536, 42158, 6329, 2, '傻豬豬你愛我什麼', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '豬豬我 我最喜歡你\n每晚夢內我都想你\n共你錫錫咀對咀距離 \n抱抱每秒永不分離 \n\n豬豬我 我最擔心你 \n每晚入夜驚你富被 \n哄你訓覺 \n不准曳曳你 \n看著你嘴角 \n最美味你嘅口水尾 \n\n一塊波板糖 我地兩份吃 \n要坐過山車 我地兩份驚 \n一塊香口膠 你吃完俾我吃 \n有時你任性 有時怪我太不羈 \n\n傻豬豬你有冇掛住我? \n我仲掛你掛得多 \n掛到日夜顛倒出錯 \n配合你天真我很傻 \n\n傻豬豬你愛我什麼 \n我便錫你更加多 \n要你做熱戀的主角 \n奧賣脾睥 錫晒你一個 \n\n豬豬我 我最喜歡你\n每晚夢內我都想你\n共你錫錫咀對咀距離 \n抱抱每秒永不分離 \n\n豬豬我 我最擔心你 \n每晚入夜驚你富被 \n哄你訓覺 \n不准曳曳你 \n看著你嘴角 \n最美味你嘅口水尾 \n\n毛毛拖鞋 我地兩份著 \n要去探鬼屋 我地兩份驚 \n一條孖煙通 我著完俾你著 \n有時你任性 有時怪我太不羈\n\n傻豬豬你有冇掛住我? \n我仲掛你掛得多 \n掛到日夜顛倒出錯 \n配合你天真我很傻 \n\n傻豬豬你愛我什麼 \n我便錫你更加多 \n要你做熱戀的主角 \n奧賣脾睥 錫晒你一個 \n\n傻豬豬你有冇掛住我? \n我仲掛你掛得多 \n掛到日夜顛倒出錯 \n配合你天真我很傻 \n\n傻豬豬你愛我什麼 \n我便錫你更加多 \n要你做熱戀的主角 \n奧賣脾睥 錫晒你一個 \n奧賣脾睥 錫晒你一個\n奧賣脾睥 錫晒你一個 X 4\n', '', 216, '', '', '', '', 'StreetVoice', 'TWS651350002', 1, 1, 0, '2013-12-17 16:37:20', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
(69537, 42158, 6329, 3, '其實毒撚一個過平安夜更開心', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '其實毒撚得一個更開心\n淪落日子 有火腩飯都感恩\n聖誕雪塑膠好逼真 太多燈飾耀眼繽紛\n可愛的少女 個個有男友身貼身\n\n其實毒撚一早要更識諗\n無謂為左中出一野 斷送一生\n咪氹我啦「講心不講金」 眼見D YEN都係咁升緊\n點再敢去行信和買超合金?\n\n夜深 似超合金\n冰凍難禁\n連大塚愛都嫁了人\n聖誕靠老人憐憫\n對住個芒會肉緊 \n到最後還是上高登 \n\n毒撚 鍾意獨身\n一個人枕\n神若夠狠請降雪\n我懷內尚有個欖枕\n全年得今晚 應該最早訓 \n\n原諒毒撚得一個更開心\n誰又亂咁嗡我得一個沒有情人\n我女友把聲好高音 日本妹名字是初音\n拋棄三次元愛情瞬間發生\n\n其實毒撚識得諗最開心\n全日「萌え」 蛋包飯共女僕人\n這裡有太多好知音 賢者跟魔法師不等\n沾上這毒癮 呢次金過大長金\n\n夜深 撈個面等\n等到悶親\n連大塚愛都嫁了人\n聖誕靠老人憐憫\n對住個芒怕夾親\n要脫毒難在有高登\n\n毒撚 一世獨身\n一個人枕\n神若夠狠請降雪\n我懷內尚有個欖枕\n啊～\n\n琵琶與美酒 馬上催我獨飲\n明明已死心 咖啡杯企不穩\n\n夜深 撈個面等\n等到發瘟\n連大塚愛都嫁了人\n聖誕靠老人憐憫\n對住個芒怕夾親\n要脫毒還是太艱辛\n\n毒撚 一世獨身\n一個人枕\n神若夠狠請降雪\n我懷內尚有個欖枕\n全年得今晚 應該最早訓 \n明日日出 再拜二次元 長門大明神\n', '', 310, '', '', '', '', 'StreetVoice', 'TWS651350003', 1, 1, 0, '2013-12-17 16:38:45', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
(69538, 42158, 6329, 4, '膠是香港', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '愛港只有一個\n有港膠所去掌舵\n愛港果個A貨\n企枱凶過差婆\n掛BANNER當功課\n紅衛兵表演親和\n喂 就唱紅歌 睇你吹嘢打鑼 \n港愛雜膠一籮\n\n愛港能人 塑膠類奇聞\n拉長伸縮 再加張摺櫈 \n包容講堅忍 插蘇式萬能\n落區式扮嘢 喂夠鐘走人\n為權為銀 成山躝藤\n一擺陣 全班都係自己人\n派紅旗撐國教 使唔使維穩\n膠是香港 膠漆力量有膠棍\n\n畜牲你有運 膠類橫行\n亞公內定TREE根 獎勵你個雲\n月月袋八雞幾嘢 笑壞人 \n一臀靈魂行運 尋金變涼粉\n一群膠亂咁嚟襯 好快有身孕\n\n愛港只有一個\n有港膠所去掌舵\n愛港果個A貨\n企枱凶過差婆\n掛BANNER當功課\n紅衛兵表演親和\n噢 強勢內膠 專派膠 搵嘢嚟攪\n港愛雜膠一籮\n\n政界西行 愛膠力人民\n你要淨心 最緊要淨身\n有力場 供我衣食住行\n佢都靠穿膠花 變超人\n你捐過億 轉頭落嚟掃金\n廸廸尼 港鐵站 一地黃金\n我地係獅子山 大家容忍\n喂 我哋送埋膠痰罐 仲交心\n\n畜牲你有運 膠類橫行\n亞公內定TREE根 獎勵你個雲\n月月袋八雞幾嘢 笑壞人 \n一臀靈魂行運 尋金變涼粉\n一群膠亂咁嚟襯 呢樹有膠運\n\n愛港只有一個\n有港膠所去掌舵\n愛港果個A貨\n企枱凶過差婆\n掛BANNER當功課\n紅衛兵表演親和\n喂 就唱紅歌 睇你吹嘢打鑼 港愛雜膠一籮x3\n', '', 178, '', '', '', '', 'StreetVoice', 'TWS651350004', 1, 1, 0, '2013-12-17 16:39:33', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
(69539, 42158, 6329, 5, '噢！多麼痛的領會', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '地產商\n早已為我定下我前路\n讀書 生仔\n接住嚟供一世\n為個兩格嘅廁所供到腎虧\n\n「為我好」\n一聽見就實在最恐怖\n活化好 死得早\n自由行 都知道\n唔去香港洗黑錢去邊處好？\n\n斷米路 如能持續發展\n無法將滔滔資金再欺騙\n你試下有搞作\n就塌晒你返去\n問你敢唔敢再存異見?\n\n遊商場Ａ 行商場Ｂ 兜商場Ｃ 返商場Ｄ\n同一投資 同一牆紙 倒模環境 連鎖牌子\nＡＢＣＤＥＦＧ\n冇曬性格呢個咩都市？\nEverywhere is a copy of a copy\n\n仲要撈\n偏偏每日自掘墳墓\n代價高 小孤島\n打統戰 高招數\n唔理好醜總之向北最好\n\n斷米路 如能持續發展\n無法將滔滔資金再欺騙\n唔怕你會口角\n但最怕你醒覺\n傻到搞抗爭就難幸免\n\n遊商場Ａ 行商場Ｂ 兜商場Ｃ 返商場Ｄ\n同一投資 同一牆紙 倒模環境 連鎖牌子\nＡＢＣＤＥＦＧ\n冇性格呢個咩都市？\nEverywhere is a copy of a copy\n\n情願唔知 寧願唔知 港英歷史 好驚人知\n唔講唔知 唔講唔知 Ｄ當權者 最喜歡你無知\n\n拆拆拆拆永不休止\n刮刮刮刮認真羞恥\n呢個過曬氣嘅動感都市\n', '', 169, '', '', '', '', 'StreetVoice', 'TWS651350005', 1, 1, 0, '2013-12-17 16:40:18', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
