(69541, 42158, 6329, 6, '起勢維穩', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '(我決定愛你 不必諗太多)\n\n夠鐘 吹下風\n老細召我入嚟 \n扭下計 偷下雞\n有過濾叫機制\n班小資 跟拍子\n永遠事與願違\n感化A 感化B\n你老豆你邊位?\n\n精叻數口 拎去服務奴隸制\n\n隊多兩劑 劇情夢幻離地夠虛偽 \n追開冇計 死要仆倒返去睇\n\n大社會\n閃光 四射\n興奮沒原因\n有快感\n冇快樂\n不要問沒原因\n我最憎\n政治\n討厭沒原因\n這粉色\n矩陣 \n起勢地維穩\n\n(我要進入你 你你莫逃避)\n\n溝淡D 生個B\n放你逐個入嚟\n新構思 新注資\n鬥快奪取身體\n假抗爭 取已爭 \n各背後有議題\n收聖旨 斬腳指\n「搵丁」壓倒一切\n\n精甩尾只不過限面前十米\n認真屌詭 \n\n執塊番梘或被騙通櫃\n一通再通 底線低得不再低\n\n謝大禮\n施恩 送贈\n樂土遍地黃金\n有熱錢 懶過問\n樂土遍地黃金\n以性交 轉運\n有金礦被鯨吞\n這粉色\n矩陣\n起勢地維穩\n\n搭到正一到七點放監 x8\n\n周末搖動身體跳舞 (Everybody shake your body)\n今個周末潛入深海跳舞 (Everybody move your body)\n今個周末投入火海跳舞 (Everybody time to party)\n的起膝頭含住手肘跳舞 (Come on baby show your money)\n今個周末搖動身體跳舞 (All the girls in the club put your hands up)\n今個周末潛入深海跳舞 (All the girls in the club put your hands up)\n今個周末投入火海跳舞 (All the girls in the club put your hands up)\n鐘意一齊成十三億跳舞 (All the girls in the club put your hands up)\n', '', 222, '', '', '', '', 'StreetVoice', 'TWS651350006', 1, 1, 0, '2013-12-17 16:41:11', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
(69542, 42158, 6329, 7, '一招收你皮', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '一招收你皮 (起勢搏矇亂咁嚟)\n巴打起晒機 (一起爭櫈仔撲飛)\n花生準了備 (保證好睇過天與地)\n等緊睇你死 (點樣睇你都冇棋)\n十個煲得三個煲蓋可以收皮\n\n2012 happy new year\n2012 新的開始\n2012 玩得開心D\n2012 一早透支\n2012 倒數開始\n2012 it''s a countdown party party~\n\n用最刺激速度連接上這軌道\n落後了要起步快追上多美好\n謝絕剎車響號無人駕駛跑道\n文明建設通道要跟這天比高早聽到\n臨界點的警報\n未發生都知道\n就上演這一套好戲請倒數\n\n一招收你皮 (起勢搏矇亂咁黎)\n巴打起晒機 (一起爭櫈仔撲飛)\n花生準了備 (保證好睇過天與地)\n等緊睇你死 (點樣睇你都冇棋)\n十個煲得三個煲蓋仲唔死\n\n仲訓到隻死豬咁\n起身喇火燭喇燒到埋身喇喂呀\n仲眷戀這種水溫\n起身喇水滾喇\n準備逃生\n\n2012 糧食儲定D\n2012 不再信電視\n2012 消失的名字\n2012 趁仲未出事\n2012 倒數開始\n2012 it''s a countdown party party~\nit''s a countdown party party~\n\n用最刺激速度連接上這軌道\n落後了要起步快追上多美好\n謝絕剎車響號無人駕駛跑道\n文明建設通道要跟這天比高早聽到\n臨界點的警報\n未發生都知道\n就上演這一套好戲請倒數\n\n（GIMMI THE FUNKY BEAT X 8）\n熱烈地彈琴熱烈地唱 X 4\n歌聲多奔放\n\n用最刺激速度連接上這軌道\n落後了要起步快追上多美好\n謝絕剎車響號無人駕駛跑道\n文明建設通道要跟這天比高\n又話要我咁做 又話最好咁做\n話帶我去邊度 你好等於我好\n又話要去呢度 但又去錯個度 \n明明我想收爐 倒數你一個數 \n\n早聽到\n臨界點的警報\n未發生都知道\n就上演這一套好戲請倒數\n\n一招收你皮 (起勢搏矇亂咁黎)\n巴打起晒機 (一起爭櫈仔撲飛)\n花生準了備 (保證好睇過天與地)\n等緊睇你死 (點樣睇你都冇棋)\n十個煲得三個煲蓋可以收皮(仲唔死)\n', '', 252, '', '', '', '', 'StreetVoice', 'TWS651350007', 1, 1, 0, '2013-12-17 16:42:20', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
(69543, 42158, 6329, 8, '起勢維穩(和諧版)', '', '2013-07-06 00:00:00', 2000, 19, 0, 1, '(我決定愛你 不必諗太多)\n\n[A1]\n夠鐘 吹下風\n老闆召我入黎 \n扭下計 偷下雞\n有過濾叫機制\n班小資 跟拍子\n永遠事與願違\n感化A 感化B\n你老豆你邊位?\n\n[B1]\n精叻數口  拎去服務奴隸制\n一早脫軌  劇情夢幻離地夠虛偽 \n 追開冇計 死要仆倒返去睇\n\n[C1]\n大社會\n閃光 四射\n興奮沒原因\n有快感\n冇快樂\n不要問沒原因\n我最憎\n政治\n討厭沒原因\n這粉色\n矩陣 \n起勢地維穩\n\n[D2]\n(我會掛住你 你你莫逃避)\n\n[A2]\n溝淡D 生個B\n放你逐個入黎\n新構思 新注資\n鬥快奪取身體\n假抗爭 取已爭 \n各背後有議題\n收聖旨 斬腳指\n「搵丁」壓倒一切\n\n精甩尾只不過限面前十米\n認真屌詭 \n執塊番梘或被困衣櫃\n想走冇計 底線低得不再低\n\n[C2]\n謝大禮\n施恩 送贈\n樂土遍地黃金\n有熱錢 懶過問\n 樂土遍地黃金\n以社交  轉運\n有金礦被鯨吞\n這粉色\n矩陣\n起勢地維穩\n\n[E]\n搭到正一到七點放監 x8\n\n[F]\n周末搖動身體跳舞 (Everybody shake your body)\n今個周末潛入深海跳舞 (Everybody move your body)\n今個周末投入火海跳舞 (Everybody time to party)\n的起膝頭含住手爭跳舞 (Come on baby show your money)\n今個周末搖動身體跳舞 (All the girls in the club put your hands up)\n今個周末潛入深海跳舞 (All the girls in the club put your hands up)\n今個周末投入火海跳舞 (All the girls in the club put your hands up)\n鐘意一齊成十三億跳舞 (All the girls in the club put your hands up) \n', '', 221, '', '', '', '', 'StreetVoice', 'TWS651350008', 1, 1, 0, '2013-12-17 16:43:25', '2015-03-12 14:03:41', '0000-00-00 00:00:00'),
